import React from 'react';

const SearchName = ({nameSearch, submitNameSearch}) => {
    return (
        <div>
            <span>Search Cocktail Name</span>
            <form onSubmit={submitNameSearch}>
                <input
                    type="text"
                    onChange={nameSearch}
                />
            </form>
        </div>
    );
}

export default SearchName;
